In ARM CCA, for some cases, RMM needs to map host memory and read/write something from/to that memory. For example, when RMI_REALM_CREATE is invoked, RMM has to get a physical memory address where parameters are placed at and read them from that memory. These accesses must be securely done as insecure implementations may open things up for attackers to break ARM CCA. We use copy_from_host_or_ret! and copy_to_host_or_ret! as a means of secure host memory access. listen!(mainloop, rmi::REALM_CREATE, |arg, ret, rmm| { let rmi = rmm.rmi; let mm = rmm.mm; // key arguments // -- Params: the type of what the host passes // -- arg[1]: a physical address that points to where we should read from let params = copy_from_host_or_ret!(Params, arg[1], mm); // ... use params ...
} What these two macros do is, do per-struct security checks and map host memory into RMM only if it passes all checks. copy from/to host memory to RMM stack memory that is bound to each CPU. unmap host memory After it gets done, we can access params that reside in RMM memory, not host memory. So it's secure against concurrency-based attacks such as double-fetch attacks. If some additional security checks on some field value are needed (e.g., Params.hash_algo should be either 0 or 1), you can do it via validate() in Accessor trait. The specified validation is called before RMM accesses host memory. impl HostAccessor for Params { fn validate(&self) -> bool { if self.hash_algo == 0 || self.hash_algo == 1 { true } else { false } }
}

